import React from "react";
import { FaHeartbeat, FaBrain, FaBone } from "react-icons/fa";
import "./Dashboard.css";

const exerciseData = [
  {
    id: 1,
    title: "Cardiac Rehab",
    icon: <FaHeartbeat size={28} />,
    exercises: ["Walking", "Step-Ups", "Breathing"],
    label: "Heart Health"
  },
  {
    id: 2,
    title: "Neuro Rehab",
    icon: <FaBrain size={28} />,
    exercises: ["Balance Training", "Gait Training", "Coordination"],
    label: "Neurological Recovery"
  },
  {
    id: 3,
    title: "Orthopedic Rehab",
    icon: <FaBone size={28} />,
    exercises: ["Squats", "Leg Raise", "Shoulder Rolls"],
    label: "Bone & Joint Recovery"
  },
  {
    id: 4,
    title: "Physiotherapy Tips",
    icon: <FaHeartbeat size={28} />,
    exercises: ["Hydration", "Proper Form", "Rest"],
    label: "Guidance"
  },
];

const Dashboard = () => {
  return (
    <div className="dashboard">
      <header className="dashboard-header">
        <h1>AI Rehab Dashboard</h1>
        <nav className="dashboard-nav">
          <a href="/">Home</a>
          <a href="/profile">Profile</a>
          <a href="/logout">Logout</a>
        </nav>
      </header>

      <main className="dashboard-content">
        {exerciseData.map((card) => (
          <div key={card.id} className="dashboard-card">
            <div className="card-header">
              {card.icon}
              <h2>{card.title}</h2>
              <span className="condition-label">{card.label}</span>
            </div>
            <ul className="exercise-list">
              {card.exercises.map((ex, i) => (
                <li key={i}>{ex}</li>
              ))}
            </ul>
            <button className="start-button">Start</button>
          </div>
        ))}
      </main>
    </div>
  );
};

export default Dashboard;
